import React, {useEffect, useState} from'react';
import './App.css';

function App() {
  const [books,data, setData] = useState([]);
  const [fetchData, setFetch] = useState(false);

  useEffect(() => {
      if (fetchData) {
         fetch('https://jsonplaceholder.typicode.com/todos')
         .then((response) => response.json())
         .then((data) => setData({books:data}));
      }
   }, [fetchData]);

    const cars = [
      {id: 1, brand: 'Ford'},
      {id: 2, brand: 'BMW'},
      {id: 3, brand: 'Audi'}
    ];

  return (
    <div className="App">
      <h1>Trip Advisor API</h1>
      <ul>
        <li>Create Site</li>
        <li>Connect to API</li>
      </ul>
      <button onClick={() => setFetch(true)}>Fetch Data</button>
      <div>Boo</div>
      <hr/>
      <ul>
        {data.map((book) => <li key={book.id}>{book.title}</li>)}
      </ul>
      {/* dd: {data.title} */}
      <hr/>
        <ul>
          {cars.map((car) => <li key={car.id}>{car.brand} </li>)}
        </ul>
    </div>
  );
}

export default App;
